package com.tivic.manager.grl.equipamento.report.dto;

public class ReportEquipamentoDTO {

	private String nmEquipamento;
	private String idEquipamento;
	private String tipoEquipamento;
	private String situacaoEquipamento;
	
	public ReportEquipamentoDTO() {
		// TODO Auto-generated constructor stub
	}

	public String getNmEquipamento() {
		return nmEquipamento;
	}

	public void setNmEquipamento(String nmEquipamento) {
		this.nmEquipamento = nmEquipamento;
	}

	public String getIdEquipamento() {
		return idEquipamento;
	}

	public void setIdEquipamento(String idEquipamento) {
		this.idEquipamento = idEquipamento;
	}

	public String getTipoEquipamento() {
		return tipoEquipamento;
	}

	public void setTipoEquipamento(String tipoEquipamento) {
		this.tipoEquipamento = tipoEquipamento;
	}

	public String getSituacaoEquipamento() {
		return situacaoEquipamento;
	}

	public void setSituacaoEquipamento(String situacaoEquipamento) {
		this.situacaoEquipamento = situacaoEquipamento;
	}
	
	
	
}
